import { Box, Typography, styled } from "@mui/material";

const Wrapper = styled(Box)`
  background: #dcf8c6;
  max-width: 60%;
  margin-left: auto;
  padding: 5px;
  width: fit-content;
  display: flex;
  border-radius: 10px;
`;

export const Message = ({ message }) => {
  return (
    <Box>
      <Typography>{message.text}</Typography>
      <Typography>{message.createdAt}</Typography>
    </Box>
  );
};
